import styled from "styled-components";

export const FormContainer = styled.section`
    height: 100vh;
    width : 100%;
    background :#1D3557;
    display : flex;
    justify-content: center;
    align-items: center;



`

export const FormWrap = styled.div`
    width : 50%;
    height : 80vh;
    background : #fff;

    @media screen and (max-width : 1024px){
        width : 60%;
    }
`
